import React from 'react'
import CircularProgress from '@material-ui/core/CircularProgress'

const Loader = () => {
  return (
    <div
      style={{
        display: 'flex',
        height: '50%',
        justifyContent: 'center',
        alignItems: 'center'
      }}
    >
      <CircularProgress size={100} />
    </div>
  )
}

export default Loader
